import React, { useRef, useState } from 'react';
import '../assets/styles/Contact.scss';
// import emailjs from '@emailjs/browser';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import SendIcon from '@mui/icons-material/Send';
import TextField from '@mui/material/TextField';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailIcon from '@mui/icons-material/Email';
import PhoneIcon from '@mui/icons-material/Phone';
import LocationOnIcon from '@mui/icons-material/LocationOn';

function Contact() {

  const [name, setName] = useState<string>('');
  const [email, setEmail] = useState<string>('');
  const [message, setMessage] = useState<string>('');

  const [nameError, setNameError] = useState<boolean>(false);
  const [emailError, setEmailError] = useState<boolean>(false);
  const [messageError, setMessageError] = useState<boolean>(false);

  const form = useRef();

  const sendEmail = (e: any) => {
    e.preventDefault();

    setNameError(name === '');
    setEmailError(email === '');
    setMessageError(message === '');

    /* Uncomment below if you want to enable the emailJS */

    // if (name !== '' && email !== '' && message !== '') {
    //   var templateParams = {
    //     name: name,
    //     email: email,
    //     message: message
    //   };

    //   console.log(templateParams);
    //   emailjs.send('service_id', 'template_id', templateParams, 'api_key').then(
    //     (response) => {
    //       console.log('SUCCESS!', response.status, response.text);
    //     },
    //     (error) => {
    //       console.log('FAILED...', error);
    //     },
    //   );
    //   setName('');
    //   setEmail('');
    //   setMessage('');
    // }
  };

  return (
    <div id="contact">
      <div className="items-container">
        <div className="contact_wrapper">
          <h1>Let's Connect</h1>
          <p>I'm always open to discussing new opportunities, collaborating on exciting projects, or simply having a chat about technology and innovation. Whether you're interested in Flutter development, competitive programming, distributed systems, or research opportunities, I'd love to hear from you!</p>

          <div className="contact-content">
            <div className="contact-info-section">
              <h2>Get In Touch</h2>
              <div className="contact-methods">
                <div className="contact-item">
                  <EmailIcon className="contact-icon" />
                  <div>
                    <h3>Email</h3>
                    <a href="mailto:kabyasaha1812@gmail.com">kabyasaha1812@gmail.com</a>
                  </div>
                </div>

                <div className="contact-item">
                  <PhoneIcon className="contact-icon" />
                  <div>
                    <h3>Phone</h3>
                    <a href="tel:+8801303359281">+880 1303 359 281</a>
                  </div>
                </div>

                <div className="contact-item">
                  <LocationOnIcon className="contact-icon" />
                  <div>
                    <h3>Location</h3>
                    <span>Dhaka, Bangladesh</span>
                  </div>
                </div>
              </div>

              <div className="social-links">
                <h3>Follow Me</h3>
                <div className="social-icons">
                  <a href="https://github.com/mithunvoe" target="_blank" rel="noreferrer" title="GitHub">
                    <GitHubIcon />
                  </a>
                  <a href="https://www.linkedin.com/in/kabya-mithun-saha-b313a2249/" target="_blank" rel="noreferrer" title="LinkedIn">
                    <LinkedInIcon />
                  </a>
                  <a href="https://codeforces.com/profile/m_ithunvoe" target="_blank" rel="noreferrer" title="Codeforces" className="codeforces-link">
                    CF
                  </a>
                </div>
              </div>
            </div>

            <div className="contact-form-section">
              <h2>Send Me a Message</h2>
              <Box component="form" ref={form} onSubmit={sendEmail} noValidate autoComplete="off">
                <div className="form-flex">
                  <TextField
                    required
                    fullWidth
                    id="outlined-required"
                    label="Your Name"
                    placeholder="John Doe"
                    value={name}
                    error={nameError}
                    onChange={(e) => setName(e.target.value)}
                    sx={{ marginBottom: '20px' }}
                  />
                  <TextField
                    required
                    fullWidth
                    id="outlined-required"
                    label="Your Email"
                    placeholder="john@example.com"
                    value={email}
                    error={emailError}
                    onChange={(e) => setEmail(e.target.value)}
                    sx={{ marginBottom: '20px' }}
                  />
                  <TextField
                    required
                    fullWidth
                    id="outlined-multiline-static"
                    label="Your Message"
                    placeholder="Tell me about your project or just say hello!"
                    multiline
                    rows={6}
                    value={message}
                    error={messageError}
                    onChange={(e) => setMessage(e.target.value)}
                    sx={{ marginBottom: '20px' }}
                  />
                  <Button 
                    variant="contained" 
                    endIcon={<SendIcon />} 
                    type="submit"
                    size="large"
                    sx={{ 
                      backgroundColor: '#4ECDC4',
                      '&:hover': {
                        backgroundColor: '#45B7D1'
                      }
                    }}
                  >
                    Send Message
                  </Button>
                </div>
              </Box>

              <div className="response-time">
                <p>ðŸ’¡ <strong>Quick Response:</strong> I typically respond within 24 hours</p>
              </div>
            </div>
          </div>

          <div className="availability-status">
            <div className="status-indicator">
              <span className="status-dot available"></span>
              <span>Available for new opportunities</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
